    overflow-y: auto;
    box-sizing: border-box;
    margin-top: 11px;
}

.addModuleButton {
    margin: 0 33px 20px;
    height: 52px;
    background: #2E62D9;
    box-shadow: 0px 4px 10px rgba(69, 69, 69, 0.1);
    border-radius: 10px;
    border: none;
    color: #FFFFFF;
    flex-shrink: 0;
    cursor: pointer;
}

.addModuleButton:hover {
    opacity: .7;
